The Broadcast video interviews, 1974-1994, subseries is comprised mainly of
              interviews, produced for broadcast by Barbaralee Diamonstein-Spielvogel, with members
              of New York's arts and architecture communities. The programs include About the Arts;
              American Architecture Now; Barbaralee Diamonstein and...; Fashion: The Inside Story;
              Handmade in America; Inside New York's Art World; Interior Design: The New Freedom;
              Visions and Images: American Photographers on Photography; as well as several
              interviews or programs independent of these series.
